import 'bootstrap/dist/css/bootstrap.min.css';
import logo from '../Components/logo.png';


function Footer() {
    return (
        <div className="footer">
            <div>
                <p>FilmFix</p>
                <img src={logo} alt="Logo" height="50" width="50"/>
            </div>
            <div>
                <p>All rights copyright</p>
            </div>
        </div>
    )
}

export default Footer;
